function LiotR() {}
LiotR.SERVER = 'http://localhost:7474';
LiotR.SESSION = null;
LiotR.post = function (a, b) {
	var c = new XMLHttpRequest();
	'function' == typeof b &&
		(c.addEventListener('load', function () {
			b(JSON.parse(c.responseText));
		}),
		c.addEventListener('error', function () {
			b({ err: 'Unable to contact server.' });
		}));
	LiotR.SESSION && (a.sessionid = LiotR.SESSION);
	c.open('POST', LiotR.SERVER);
	c.setRequestHeader('Content-type', 'application/json');
	c.send(JSON.stringify(a));
	return c;
};
